	add("bosom", "{\"term\":\"bosom\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"Irish\", \"Latin\", \"Dutch\", \"Romanian\", \"Albanian\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|bōsm}}. Cognate with Dutch \u0027boezem\u0027 German \u0027busen\u0027 From Proto-germanic {{m|gem-pro|*bōsmaz}}, itself from Proto-indo-european {{m|ine-pro|*bheu-ə-||to swell, bend, curve}}, whence also Albanian \u0027buzë\u0027 (lip) Romanian \u0027buză\u0027 (lip) Irish \u0027bus\u0027 (lip) and Latin \u0027bucca\u0027 (cheek)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The breast or chest of a human (or sometimes of another animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027, \u0027Bible\u0027, Authorized Version, IV\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And the LORD said furthermore unto him, Put now thine hand into thy \u0027\u0027bosom\u0027\u0027. And he put his hand into his \u0027\u0027bosom\u0027\u0027: and when he took it out, behold, his hand was leprous as snow.\u0026lt;!-- This quote is repeated below in another sense !!!--\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The seat of one\u0027s inner thoughts, feelings etc.; one\u0027s secret feelings; desire\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"my poor dear duke, in consequence of the excitement created in his august \u0027\u0027bosom\u0027\u0027 by her frantic violence and grief, had a fit in which I very nigh lost him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL45537W Friday\u0027s passage\u003dHis uncle, a Cardinal, engages a Spanish youth of Moorish descent called Diego, an expert singer and player on the virginal,to cleanse his \u0027\u0027bosom\u0027\u0027 of the perilous stuff, and cure him by the spell of his music\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The protected interior or inner part of something; the area enclosed as by an embrace\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"133; Mr Toodle \u0026amp\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"133; was refreshing himself with tea in the \u0027\u0027bosom\u0027\u0027 of his family\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"there might be seen in districts far away among the lanes, or deep in the \u0027\u0027bosom\u0027\u0027 of the hills, certain pallid undersized men, who, by the side of the brawny country-folk, looked like the remnants of a disinherited race\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The part of a dress etc. covering the chest; a neckline\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Bible, iv\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"He put his hand into his \u0027\u0027bosom\u0027\u0027: and when he took it out, behold, his hand was leprous as snow. \u0026lt;!-- This quote is repeated above in another sense !!!--\u0026gt\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"She was always in a fearful hurry, and the lower the \u0027\u0027bosom\u0027\u0027 was cut the more it was to be gathered she was wanted elsewhere\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s breasts\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Serene, smiling, enigmatic, she faced him with no fear whatever showing in her dark eyes.She put back a truant curl from her forehead where it had sought egress to the world, and looked him full in the face now, drawing a deep breath which caused the round of her \u0027\u0027bosom\u0027\u0027 to lift the lace at her throat\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Martin Kelner, \u0027The Guardian\u0027, 7 April\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The prevailing look at Aintree was of a well-upholstered woman wearing an outfit about three sizes too small for her; trouser suits so tight you could not only tell if the lady had a coin in her pocket but see if it was heads or tails, and skimpy tops proclaiming proudly that \u0027\u0027bosoms\u0027\u0027 are back\u0026amp;mdash;and this time it\u0027s personal\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Any thing or place resembling the breast; a supporting surface; an inner recess; the interior\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1672-1719\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027bosom\u0027\u0027 of the ocea\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A depression round the eye of a millstone\", \"priority\":22}]}, \"synonyms\":{}}");

	add("bossman", "{\"term\":\"bossman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|boss|man|lang\u003den}}. First used in the late 1940s, though the usage of \u0026quot;boss\u0026quot; by itself as a form of contempt or to show that one is on their guard dates back to 1552. Term seems to have originally been a pejorative term for a local official.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone whose name is unknown. Usually denotes that one is chary or extremely unfamiliar with the person being spoken to.:*: \u0026quot;\u0027You should watch what you say, bossman.\u0027\u0026quot;:*: \u0026quot;\u0027I don\u0027t know what to tell you, bossman...\u0027\u0026quot;2. Someone who appears stalwart and/or dauntless in both disposition and appearance. Not a term used between those who are close. Usually seen as complimentary.:*: \u0026quot;\u0027You really showed them, bossman. What\u0027s your name?\u0027\u0026quot;:*: \u0026quot;\u0027Hoy, bossman. It\u0027s been a while since you last travelled through here. Are there any new goings on?\u0027\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

